import styles from "./ArticleCard.module.css";
import logo from "../../assets/websiteIcons/fioneers-ico.png";

export default function ArticleCard(props) {
  return (
    // <div className={styles.articleCardContainer} >
    <a className={styles.articleCardContainer} href={props.url}>
      <img className={styles.articleSrcLogo} src={logo} />
      <img className={styles.image} src={props.image} />
      <div className={styles.textContainer}>
        <p className={styles.title}>Lorem Ipsum Dolor</p>
        <p className={styles.description}>
          Lorem ipsum dolor sit amet, consectetur adipiscing elit. Ut et massa
          mi. Aliquam in hendrerit urna. Pellentesque sit amet sapien fringilla,
          mattis ligula consectetur, ultrices mauris. Maecenas vitae mattis
          tellus.
        </p>
        <p className={styles.details}>Aug 10, 2022 | Health</p>
      </div>
    </a>
    // </div>
  );
}
